import React from "react";
import Model from "../models/Model.js";
export default class List extends React.Component {
    constructor(props) {
        super(props);
        console.log(props);
    }
    render() {
        return (
            <div className="List">
                 <div className = "row">
                    {this.props.list.map(model => {
                        if(model._id){
                            return(
                                <div className="col-lg-4">
                                    <Model model = {model}/>
                                </div>
                            )
                        }
                        return(
                            <div className="col-lg-4">
                                <div >{model}</div>
                            </div>
                        )
                    })}
                 </div>
            </div>
        )
    }
}
